import React from 'react';

const Generate = () => {
  return (
    <div className="max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold text-gray-900 mb-2">Generate Synthetic Data</h1>
      <p className="text-gray-600 mb-8">Configure and generate synthetic datasets</p>

      <div className="bg-white p-8 rounded-lg border text-center">
        <p className="text-gray-500">Generation interface coming soon...</p>
      </div>
    </div>
  );
};

export default Generate;
